  \"2015-02-04T18:50:44.937554\",\n\t\"name\": \"red-light-cameras-28127\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Motorists who drive aggressively and exceed
  the posted speed limit by at least 12 miles per hour will receive $40 citations
  in the mail. These citations are not reported to insurance companies and no license
  points are assigned. Notification signs will be placed at all speed enforcement
  locations so that motorists will be aware that they are approaching a speed check
  zone. The goal of the program is to make the streets of Baltimore safer for everyone
  by changing aggressive driving behavior. In addition to the eight portable speed
  enforcement units, the city has retrofitted 50 red light camera locations with the
  automated speed enforcement technology.\",\n\t\"license_title\": \"Other License
